import React from "react";

function Experience(){
    return(
        <>
            <div className="container">
                        <h1>Experience</h1>
                        <h2>Upwork</h2>
                        <h4>Freelancer</h4>
                        <p>Web development including HTML, CSS, JavaScript, Reactjs, BootStrap</p>
                        <p>January 2020 - present</p>
                    
            </div>
        </>
    )
}

export default Experience;
